import React,{useState,useEffect} from 'react'


const Display = () => {
    
    const [displays,setDisplays]=useState([]);
    const getData=async()=>{
        try {
            const data= await fetch("/display")
            if(data.ok){
                const result=await data.json();
                setDisplays(result)
                console.log(result);
            }
        } catch (error) {
            console.log(error)
        }
    }
    useEffect(() => {
        getData();
    }, [])
    return (
        <div>
            <h1>Display</h1>
            {displays.map(item=>{
                return <><p>{item.StoreName}</p><p>{item.StoreName}</p></>
            })}
        </div>
    )
}

export default Display
